# Structure for table "tb_faq"
#

CREATE TABLE `tb_faq` (
  `id_faq` int(11) NOT NULL AUTO_INCREMENT,
  `pertanyaan` text DEFAULT NULL,
  `jawaban` text DEFAULT NULL,
  `id_faq_kategori` int(6) DEFAULT NULL,
  PRIMARY KEY (`id_faq`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

#
# Data for table "tb_faq"
#

INSERT INTO `tb_faq` VALUES (6,'Apa itu Helpdesk Syariah','<p><em><strong>Helpdesk Syariah</strong></em> portal untuk cabang dalam meminta bantuan mengenai support produk sebagai pengganti google form. Web ini dibuat hanya untuk karyawan BFI Syariah dan akan selalu dikembangkan sesuai dengan kebutuhan.</p>\r\n',1),(7,'Bagaimana saya aksesnya?','<p>Anda dapat mengaksesnya melalui Desktop/Mobile (Handphone/Komputer) dengan alamat <a href=\"http://helpdesk.bfisyariah.id\">helpdesk.bfisyariah.id</a> dan wajib ada internet untuk mengaksesnya.</p>\r\n',1),(8,'Bagaimana saya mengajukan ticket support?','<p>Silahkan pilih menu <strong><em>Request Ticket</em></strong> pada sidebar menu dan pilih bantuan yang anda butuhkan jika anda menggunakan komputer, atau tekan tombol garis tiga di pojok kanan dan pilih <strong><em>Request Ticket.</em></strong></p>\r\n',1),(9,'Menu tidak keluar (error/blank), apa yang saya harus lakukan?','<p>Jika anda menggunakan Google Chrome silahkan coba tekan tombol “SHIFT” dan “F5” pada keyboard untuk refresh. Jika anda menggunakan Firefox silahkan coba tekan tombol “CTRL” dan “F5” pada keyboard. Jika anda menggunakan Chrome di handphone silahkan ikuti langkah dibawah ini</p>\r\n\r\n<p><img xss=removed>   <img k=\" style=\">  <img k=\" style=\"></p>\r\n\r\n<p>Jika masih error/blank harap hubungi Tim HO.</p>\r\n',1),(10,'Fitur apa saja yang bisa dilakukan oleh website ini ?','<p>Request bantuan Produk, Request NST, Aktivasi Agent, Input Lead Management, Daftar Leads, Ubah Data, Status Data, SLA Support dan lainnya yang akan terus dikembangkan.</p>\r\n',1),(18,'Bagaimana saya membuat akun?','<p>anda dapat klik menu “Buat Akun”, masukkan data yang valid. Pastikan NIK dan Email valid dan dapat diakses dan diharapkan tidak lupa dengan password. Kemudian hubungi tim HO untuk Aktivasi akun anda.</p>\r\n\r\n<p><img alt=\"\" src=\" http://helpdesk.bfisyariah.id/uploads/faq/register.png\" xss=removed></p>\r\n',2),(19,'Saya Lupa password, Bagaimana agar bisa masuk kembali?','<p> </p>\r\n\r\n<p>anda dapat klik menu “Klik disini jika lupa password”, silahkan masukkan email yang sudah didaftarkan dan cek inbox email anda. Jika tidak ada cek folder SPAM, disana akan ada password yang sudah digenerate. Kemudian silahkan masuk ke halaman login dan masukkan email dan password yang sama pada email. Jika berhasil masuk harap langsung mengganti password yang lama dengan password baru pada menu profile</p>\r\n\r\n<p><img alt=\"\" src=\" http://helpdesk.bfisyariah.id/uploads/faq/lupa_password.png\" xss=removed></p>\r\n',2);

